import React from "react";
import styles from "./Navigastion.module.css";

function Navigastion(props) {
  return (
    <div className={(styles.navigastion, styles.active)}>
      <div>
        <a href="#">{props.name}</a>
      </div>
    </div>
  );
}

export default Navigastion;
